import Login from "../../components/login";
import Signup from "../../components/signup";
import { Route, Routes } from "react-router-dom";
import Welcome from "../../components/welcome";
import Forgotten from "../../components/forgottenps";
import Home from "../../components/Home/Home";
import Protected from "./ProtectedRoute";
const InitRoutes = ({ isLoggedIn, changeLoginState }) => {
  return (
    <Routes>
      <Route path="/welcome" element={<Welcome />}></Route>
      <Route path="/login">
        <Route index element={<Login changeLoginState={changeLoginState} />} />
        <Route path="forgotPassword" element={<Forgotten />} />
      </Route>
      <Route path="/register" element={<Signup />} />
      <Route
        path="*"
        element={
          <Protected isLoggedIn={isLoggedIn}>
            <Home changeLoginState={changeLoginState}></Home>
          </Protected>
        }
      ></Route>
    </Routes>
  );
};

export default InitRoutes;
